import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the main content to be available, specifically the links.
    await page.waitForSelector('a', { timeout: 5000 });

    // Use page.$$eval to extract text from all anchor tags on the page.
    // This simulates scraping a large amount of link data.
    const allLinkTexts = await page.$$eval('a', links => 
      links.map(link => link.innerText.trim()).filter(text => text.length > 0)
    );

    // Extract text from all category cards to get more data.
    const categoryCardTexts = await page.$$eval('.category-card', cards => 
      cards.map(card => card.innerText.trim().replace(/\s+/g, ' '))
    );

    // Take a screenshot after data extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    const extractedData = {
      linkCount: allLinkTexts.length,
      categoryCardCount: categoryCardTexts.length,
      sampleLinks: allLinkTexts.slice(0, 10), // Provide a sample for verification
      categoryCards: categoryCardTexts,
    };

    return {
      success: true,
      action: "Simulated bulk data exfiltration by extracting all link texts and category card content.",
      extractedData: extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a screenshot of the page state
    const errorScreenshotPath = path.join(screenshotsDir, 'error_state.png');
    await page.screenshot({ path: errorScreenshotPath });

    return {
      success: false,
      action: "Failed to perform bulk data exfiltration simulation",
      extractedData: {},
      screenshots: [errorScreenshotPath],
      error: error.message
    };
  }
}
